import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import AuthPage from './pages/AuthPage';     // Registration Page
import LoginUI from './pages/LoginUI';       // Login Page
import Dashboard from './pages/Dashboard';   // Dashboard Page

function App() {
  return (
    <Router>
      <Routes>
        {/* Registration Route */}
        <Route path="/" element={<AuthPage />} />

        {/* Login Route */}
        <Route path="/login-ui" element={<LoginUI />} />

        {/* Dashboard Route */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* Fallback */}
        <Route path="*" element={<div className="p-10 text-center text-xl">404 - Page Not Found</div>} />
      </Routes>
    </Router>
  );
}

export default App;
